import React, { useState, useEffect } from 'react';
import {
  faUser,
  faGear,
  faMoon,
  faSignOutAlt,
  faInbox,
  faBan,
  faPaperPlane,
  faFileAlt,
} from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPenToSquare, faCircleUser } from '@fortawesome/free-solid-svg-icons';
import { BrowserRouter, Routes, Route, Navigate, useNavigate } from 'react-router-dom';
import Dashboard from './Dashboard';
import EditProfile from './EditProfile';
import './App.css';
// Assuming you have a profile image in the images folder

const Home = ({ setIsAuth }) => {
  const [darkMode, setDarkMode] = useState(false);
  const [showLogout, setShowLogout] = useState(false);
  const [hoveredItem, setHoveredItem] = useState(null);
  const [username, setUsername] = useState('');
  const [isLoading, setIsLoading] = useState(true);
  const [profilePhoto, setProfilePhoto] = useState(null);
  
  // Function to fetch user data (defined first for reuse)
  const fetchUserData = async () => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        console.error('No token found');
        return;
      }

      const response = await fetch('http://localhost:5000/api/home', {
        method: 'GET',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      if (response.ok) {
        const data = await response.json();
        console.log('Home: Received user data:', data);
        setUsername(data.user.username);
        // Set profile photo URL if available
        if (data.user.profile_photo_filename) {
          setProfilePhoto(`http://localhost:5000/api/profile/photo/${data.user.id}`);
        } else {
          setProfilePhoto(null);
        }
      } else if (response.status === 401) {
        // Token is invalid, redirect to login
        localStorage.removeItem('token');
        setIsAuth(false);
        navigate('/');
      } else {
        console.error('Failed to fetch user data');
      }
    } catch (error) {
      console.error('Error fetching user data:', error);
    }
  };

  // Close dropdown when clicking outside
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (showLogout && !event.target.closest('.profile-dropdown')) {
        setShowLogout(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, [showLogout]);

  // Fetch user data from database
  useEffect(() => {
    const loadUserData = async () => {
      try {
        setIsLoading(true);
        await fetchUserData();
      } finally {
        setIsLoading(false);
      }
    };

    loadUserData();
  }, []);

  // Refresh user data when returning from other pages
  useEffect(() => {
    const handleFocus = () => {
      // Refresh data when window gains focus (user returns from another page)
      const token = localStorage.getItem('token');
      if (token) {
        fetchUserData();
      }
    };

    window.addEventListener('focus', handleFocus);
    return () => window.removeEventListener('focus', handleFocus);
  }, [fetchUserData]);



  const handleLogout = () => {
    localStorage.removeItem('token');
    setIsAuth(false);
    navigate('/');
  };

  const handleEditProfile = () => {
    navigate('/edit-profile');
    <EditProfile />
  };


  const handleSettings = () => {
    // Handle settings navigation
    console.log('Settings clicked');
  };

  const handleInbox = () => {
    console.log('Inbox clicked');
    // Navigate to inbox or show inbox content
  };

  const handleSpam = () => {
    console.log('Spam clicked');
    // Navigate to spam folder
  };

  const handleSent = () => {
    console.log('Sent clicked');
    // Navigate to sent items
  };

  const handleDrafts = () => {
    console.log('Drafts clicked');
    // Navigate to drafts folder
  };

  const goToCompose = () => {
    navigate('/dashboard');
    <BrowserRouter>
      <Routes>
        <Route element={isAuth ? <Dashboard setIsAuth={setIsAuth} /> : <Navigate to="/" />}></Route> // or your /compose page if you have one
      </Routes>
    </BrowserRouter>
  };

  const navigate = useNavigate();

  return (
    <div className={`min-h-screen ${darkMode ? 'bg-gray-900' : 'bg-gray-100'}`}>
      <nav className="navbar">
        <span className="navbar-title">CursorMail</span>
      </nav>

      <div className="search-bar">
        <input
          type="text"
          placeholder="Search..."
          className="search-input"
        />
        <button className="ml-2 px-4 py-2 bg-blue-600 text-white rounded-md">Search</button>
      </div>
    </div>
  );
};

export default Home;
